import React, { useState } from 'react';
import { Box, Text, Grommet, Main, Heading, Button } from 'grommet';
import Foooter from './component/Foooter';
import Headerr from './component/Headerr';
import CardsForm from './component/CardsForm';
import TabsForm from './component/TabsForm';
import TabsForm2 from './component/TabsForm2';
import InputForm from './component/InputForm';
import { Redirect, useHistory } from 'react-router-dom';



function App() {

  const theme = {
    global: {
      colors: {
        brand: '#01A982',
      },
      font: {
        family: 'Roboto',
        size: '18px',
        height: '20px',
      },
    },
  };

  let history = useHistory();

  const [isAuth, setIsAuth] = useState(true);

  if(!isAuth){
    return <Redirect to="/Component/NewFile" />
  }


  return (

    <Grommet theme={theme}>
      <Headerr />
      <Main pad="small" margin={{ left: 'large', right: 'large'}} >
        <Box>
          <Heading margin={{ left: "small",top: "small", bottom: "none"}}>Hello, Jane!</Heading>
          <Text margin="small">Welcome to the HPE Common Cloud Console.</Text>
        </Box>
          <CardsForm />
      </Main>
      <Box justify="end" aria-setsize="small" gap="small" direction="row-reverse">
        <Button primary label=" Back " size="small" onClick={() => history.goBack()} />
      </Box>
      <Foooter />
      <br />
      <br />
      <TabsForm />
      <br />
      <br />
      <TabsForm2 />
      <br />
      <br />
      <Button onClick={() => setIsAuth(false)}>Click Me</Button>
      <div>isAuth: {isAuth.toString()}</div>


    </Grommet>
  );
}

export default App;
